export const ApiUrl: string = "https://reqres.in/api/products";

export const FetchApi = async (params: string = "") => {
    return fetch(`${ApiUrl}${params}`)
        .then(async (response): Promise<any> => {
            if (response.ok) {
                return await response.json();
            }
        })
        .catch((err) => {
            return { error: "error" };
            console.error(err);
        });
};
